INSERT INTO `forecasts` (`id`, `signId`, `forecast`, `forecastDate`) VALUES
(1, 1, 'В январе вас ждет много работы, с которой вы сможете справляться быстрее и эффективнее. Важно лишь проявлять последовательность в своих действиях. В это время у вас получится открыто выяснять отношения с коллегами. Но не доходите в таких разборках до проявлений агрессии, это вряд ли добавит очков вашей профессиональной репутации. Первая половина января позволит вам наладить взаимоотношения с друзьями, сделает более гармоничными контакты с единомышленниками. В этот период не отказывайтесь от встреч и общения со своими близкими. Во второй половине месяца вам захочется ощутить комфорт, побыть наедине с собой. Не исключено появление тайной любовной привязанности, начало романа, который в итоге вы захотите скрыть от широкой общественности.', 'январь 2012'),
(2, 2, 'Активность в январе будет наблюдаться в личной жизни. Одинокие Тельцы будут более напористыми в отношениях с противоположным полом, внимание окружающих также увеличится. Это прекрасное время для свиданий. В существующих отношениях усилится страсть и романтика. Но не забывайте и сами приложить усилия в данном направлении. Месяц неплохо подходит для творческой самореализации, но в таких делах стремитесь быть более последовательными. Первая половина января принесет знакомства с влиятельными или известными людьми. Во второй половине месяца у вас могут появиться новые интересные планы, благодаря которым расширится круг вашего общения.', 'январь 2012'),
(3, 3, 'Расположение планет в течение первого месяца 2012 года принесет активность в домашние дела. Сейчас вы сможете многое сделать по дому, заняться благоустройством своего жилья. В своей работе по созданию комфорта и уюта старайтесь быть последовательными. Это поможет успеть сделать больше за короткий промежуток времени и избежать многократного выполнения одних и тех же задач. Первая половина месяца отлично подходит для путешествий, общения с иностранцами, расширения собственного кругозора. Более удачливыми в вопросах карьеры вы станете во второй половине месяца. Результаты труда будут более заметными и очевидными, что может послужить поводом для вашего повышения.', 'январь 2012'),
(4, 4, 'Первый месяц 2012 года принесет типичным Ракам больше прямого и открытого общения. Повышается склонность к спорам. Старайтесь чаще оценивать необходимость участия в тех или иных дискуссиях. Это время благоприятно для активного отдыха на природе, небольших путешествий. Но старайтесь заранее планировать свои поездки и составлять маршруты, это поможет провести свободное время более эффективно. В первой половине января вас могут ждать приятные события в личных отношениях. Увеличится значимость интимной стороны союза. Сейчас вы сможете почувствовать единение с партнером и получать больше удовольствия от нахождения рядом с любимым человеком. Вторая половина месяца сулит успех в делах, связанных с обучением.', 'январь 2012'),
(5, 5, 'Расположение планет в январе указывает на более активное стремление к улучшению своего материального положения. Скорее всего, вы захотите приложить больше активных усилий в этом направлении, но при этом рискуете быть непоследовательными. Именно поэтому стоит заранее составить план своих действий, тогда вы меньшими усилиями сможете достигнуть более заметных результатов. В первой половине января вероятны новые романтические знакомства, которые могут стать началом серьезных и длительных любовных отношений. В существующих отношениях будет больше теплоты, чувственности. Во второй половине января увеличится важность интимной стороны жизни, усилится тяга к плотским удовольствиям. Это время также можно использовать для решения любых вопросов, связанных с долгами, кредитами и инвестициями.', 'январь 2012'),
(6, 6, 'Этот месяц окажется довольно активным. Вы сможете многое делать быстро, но лишь в том случае, если будете проявлять последовательность в своих действиях. В противном случае нередко придется возвращаться и начинать делать что-то с самого начала. Сил и энергии хватит и на это, но все же лучше спланировать и хорошо продумать свою активность. Тогда вы успеете больше. Первую половину января стоит посвятить заботе о своем здоровье. Постарайтесь дать отдохнуть организму, уделите внимание спорту, общению с природой. Вторая половина месяца позволит наладить личные взаимоотношения, которые сейчас будут развиваться более гармонично.', 'январь 2012'),
(7, 7, 'В январе вы, скорее всего, станете проявлять активный интерес ко всему непознанному или неизведанному, усилится интерес к мистике. Возможно, вы захотите разгадать какие-то тайны. Другие люди в этот период будут охотнее доверять вам свои секреты, поэтому постарайтесь не делать их достоянием общественности. Первая половина месяца принесет вам много романтики, любовных приключений и новых знакомств. В существующих отношениях появится больше радости от совместного времяпровождения с любимым человеком. Вторая половина января хорошо подходит для работы. Сейчас вы с большей охотой будете выполнять свои должностные обязанности.', 'январь 2012'),
(8, 8, 'В течение этого месяца у вас появится много новых планов и идей, которые вы сможете активно реализовывать. Старайтесь быть последовательными. Сейчас лучше чуть больше времени потратить на детальную разработку проекта, тогда вы значительно продвинетесь в своей деятельности. В первой половине января стоит больше времени уделить своим близким, членам вашей семьи. Большую часть новогодних праздников рекомендуется провести в окружении родственников. Обязательно навестите родителей, как бы далеко вы от них не жили. Вторая половина месяца принесет больше романтики, развлечений и стремления к удовольствиям. Это отличное время для посещения и организации вечеринок, участия в различных конкурсах и викторинах.', 'январь 2012'),
(9, 9, 'Расположение планет в течение этого месяца рекомендует прилагать активные усилия для достижения своих целей. Вы сможете быть достаточно решительными, смелыми и целеустремленными для этого. Звезды рекомендуют заранее определиться со своими планами, чтобы прилагать усилия в одном направлении и не распыляться на множество дел сразу. Если вы будете последовательны в своих стремлениях, то сможете добиться неплохих успехов в течение этого периода. Первая половина месяца принесет много приятного общения, удачно будут складываться небольшие поездки, не исключены приятные знакомства и флирт. Во второй половине января можно создавать уют и комфорт в своем доме, проводить небольшой косметический ремонт.', 'январь 2012'),
(10, 10, 'Типичным Козерогам звезды рекомендуют в январе проявить активность в получении новых знаний и расширении собственного кругозора. Сейчас можно отправляться в путешествие, изучать культуру или традиции других народов. Вы также можете начать исследование какой-либо интересной вам области знаний. Важно не переключаться с одного дела на другое, а изучать все последовательно.&nbsp; В первой половине января вы будете удачливы в финансовых вопросах. Весьма вероятно, что новогодние праздники запомнятся вам помимо всего прочего еще и качественными и дорогими подарками. Вторая половина января принесет немало приятного общения и новые интересные знакомства с симпатичными вам людьми.', 'январь 2012'),
(11, 11, 'В течение этого месяца вы сможете принять важные решения в своей жизни. Сейчас вы внутренне окажетесь готовыми к различным переменам, поэтому будете способны на решительные шаги. Стоит опасаться безрассудства, любые риски должны быть оправданными в течение этого периода. В первой половине месяца чаще проявляйте свое обаяние. Так вы сможете привлечь интересных и симпатичных вам людей. В это время вы будете более привлекательными, а порой и просто неотразимыми. Скорее всего, подобные перемены произойдут после корректировки вашего имиджа: прически, стиля одежды. Вторая половина месяца принесет удачу в финансовых вопросах. Это время благоприятно для совершения покупок.', 'январь 2012'),
(12, 12, 'Положение планет в январе указывает на повышенную активность в сфере личных и деловых взаимоотношений. В этих областях вы сможете принять важные решения. Нередко ситуация станет складываться таким образом, что некоторое время вы будете обдумывать свои поступки, размышлять о том, каким способом проявить инициативу, а в последний момент начнете действовать спонтанно и непредсказуемо. Если свою активность тщательно спланировать, то результат окажется более эффективным. Первая половина января может принести вам тайный роман или необычное любовное приключение. Во второй половине месяца займитесь своей внешностью. Это отличное время для того, чтобы обновить свой гардероб, сделать новую прическу или изменить цвет волос.', 'январь 2012'),
(13, 1, 'В течение этого месяца рекомендуется воздержаться от излишней активности на работе. Сейчас вы склонны действовать быстро и необдуманно. Вероятность того, что придется переделывать какие-то вещи, довольно высока, поэтому стоит быть более последовательными в своей активности. Первая половина этого месяца принесет больше общения с друзьями. Не исключено, что у вас могут появиться новые увлечения, которые позволят вам расширить свой круг единомышленников. Вторую половину февраля желательно посвятить отдыху, а также размышлениям в одиночестве. Весьма вероятно, что в уединении вы сможете лучше разобраться со сложными ситуациями, а также придумаете интересные проекты.', 'февраль 2012'),
(14, 2, 'Расположение планет в течение этого месяца указывает на то, что вы можете стать непоследовательными в любовных отношениях. Велика вероятность непродуманных поступков, о которых вы впоследствии пожалеете. Именно по этой причине старайтесь не форсировать развитие романа, перед каждым важным этапом в отношениях стоит брать небольшую паузу. Так вы сможете избежать особенно нелепых ошибок. Первая половина февраля поможет вам лучше осознать свои цели и задачи, окружить себя единомышленниками. Новые планы и идеи будут чаще возникать во второй половине февраля. Этот период можно также считать благоприятным для любой коллективной деятельности.', 'февраль 2012'),
(15, 3, 'В феврале типичным представителям вашего зодиакального знака не рекомендуется начинать крупный ремонт в своем доме или квартире. Сейчас вы можете быть слишком поспешными в таких делах или просто непоследовательными, из-за чего многое придется переделывать заново. Первую половину месяца лучше использовать для получения новых знаний, обучения. Можно записаться на какие-либо курсы либо просто более глубоко изучить ту информацию, которую вы получаете в образовательном учреждении или на работе. Во второй половине февраля вы сможете весьма успешно проявить себя в карьере. Удача в этой области окажется на вашей стороне.', 'февраль 2012'),
(16, 4, 'В течение последнего зимнего месяца типичным Ракам рекомендуется быть более осторожными во время поездок и небольших путешествий. Если планируете куда-то ехать, стоит заранее проработать свой маршрут. Это поможет избежать потери времени. Старайтесь также в течение февраля избегать споров. Кого-то убедить в чем-либо будет не так просто, да и вы сами можете сейчас быть непоследовательными, что также осложнит поиск истины. Первая половина месяца, скорее всего, принесет вам новые мысли относительно инвестиций либо идеи о том, как использовать заемные средства в своем бизнесе. Вторая половина февраля подходит для обучения и путешествий.', 'февраль 2012'),
(17, 5, 'Типичным Львам в феврале звезды рекомендуют повременить с принятием решений относительно финансов. Сейчас стоит более внимательно обращаться с личными деньгами. Отложить также рекомендуется совершение крупных покупок. Есть риск приобрести не совсем то, что вы хотели, либо у товара через некоторое время проявятся скрытые дефекты. В первой половине февраля свою активность лучше направить на личные отношения. Сейчас вы сможете легче обсуждать любые темы с близким человеком, станет проще находить компромиссы. Больше гармонии звезды обещают и в интимной жизни. Во второй половине февраля удачно будут решаться любые вопросы, связанные с долгами, налогами или какими-либо обязательствами.', 'февраль 2012'),
(18, 6, 'Расположение планет в феврале указывает на то, что вы можете стать довольно непоследовательными. Для вас характерна долгая подготовка к решительному действию, при этом в момент икс вы можете повести себя весьма спонтанно. Такого подхода сейчас нужно избегать, хотя сделать это будет очень непросто. Возможно, стоит повременить пока с излишней активностью и слишком частым проявлением инициативы. В первой половине февраля вы сможете успешно проявить себя на работе, в интеллектуальной и теоретической областях. Во второй половине месяца станет легче налаживать деловые связи, повысится ваша склонность к компромиссам.', 'февраль 2012'),
(19, 7, 'В течение этого периода вы можете испытывать внутренние противоречия. Не исключено возвращение прошлых страхов, особенно тех, которые так или иначе связаны с одиночеством. Попробуйте использовать этот период для анализа своего прошлого. Не исключено, что некоторые ошибки вам удастся исправить. Даже если этого не произойдет, вы все равно сможете лучше понять причины былых успехов и неудач. Первую половину февраля рекомендуется посвятить интеллектуальному творчеству. Вам сейчас будет проще выразить себя через общение. Вторая половина месяца принесет удачливость в личные отношения, позволит завязать новые знакомства. Успех также ждет вас на работе.', 'февраль 2012'),
(20, 8, 'В феврале типичных Скорпионов ждут встречи со старыми друзьями и единомышленниками. Появится стремление вернуться к прошлым идеям, увлечениям. Однако сходу пытаться реализовывать подобные планы не рекомендуется. Скорее всего, вы просто повторите былые неудачи. Свою активность лучше направить на поиск причин, которые помешали вашим проектам в прошлом. Уже потом можно предпринять еще одну попытку, которая после столь детальной проработки будет иметь куда больше шансов на успех. Первая половина месяца благоприятна для налаживания отношений с родными. Романтические знакомства более вероятны в самом начале февраля, а также в течение всей второй половины месяца.', 'февраль 2012'),
(21, 9, 'Расположение планет в феврале указывает на то, что вы можете проявлять поспешность или непоследовательность в достижении своих целей. Не исключено, что вы будете добиваться чего-то одного, а в итоге решите, что вам нужно совсем другое. Именно поэтому, прежде чем начинать проект, стоит убедиться в том, что усилия прикладываются в нужном направлении. Аналогичная ситуация может складываться и в карьере. Стремитесь добиваться лишь того, что вам действительно нужно. Первая половина месяца будет удачной для небольших поездок. Гармонично станет складываться и повседневное общение. Во второй половине месяца больше времени уделите семье, а также романтическим отношениям.', 'февраль 2012'),
(22, 10, 'Февраль принесет вам тягу к новым знаниям и проведению собственных исследований. Однако не исключено, что интерес будет переменным: то вы со всем рвением станете изучать какой-нибудь предмет, то вовсе переключитесь на совершенно противоположное занятие. Сейчас стоит более четко выбирать направление, в котором вы хотите двигаться, и быть более последовательными в своих исследованиях или экспериментах. В первой половине месяца активность можно проявить в денежных вопросах. Скорее всего, у вас появятся интересные идеи относительно управления личными финансами. Вторая половина месяца более благоприятна для небольших поездок, приема гостей и общения.', 'февраль 2012'),
(23, 11, 'В феврале типичным Водолеям стоит быть осторожнее. Сейчас повышается вероятность получения травм из-за поспешности или невнимательности. Вы можете стать более рассеянными, что и станет причиной неприятностей. Постарайтесь быть последовательными в личной жизни, а также в управлении заемными или чужими деньгами. Если вы занимаетесь бизнесом, то в феврале не принимайте рискованных решений. В первой половине месяца чаще демонстрируйте свою эрудицию, это будет притягивать к вам людей. Вторая половина февраля позволит вам проанализировать несколько новых идей в финансовой области, а также может привести к пересмотру некоторых жизненных ценностей.', 'февраль 2012'),
(24, 12, 'Расположение планет в феврале указывает на то, что типичным представителям вашего зодиакального знака рекомендуется воздержаться от решительных шагов в личных и деловых взаимоотношениях. Сейчас вы можете быть непоследовательны в своих поступках. Поэтому рекомендуется сначала определиться, чего вы хотите добиться, а только после этого действовать. В первой половине февраля чаще проявляйте личное обаяние, выбирайте правильный режим труда, не забывайте об отдыхе. Вторая половина месяца позволит вам блистать эрудицией. Не исключено, что вы станете более любознательными и общительными.', 'февраль 2012'),
(25, 1, 'Этот месяц принесет типичным представителям вашего зодиакального знака успех в материальной сфере. Сейчас вы сможете более успешно вести финансовые дела, совершать выгодные покупки, находить способы увеличения своих доходов. Важно лишь быть более последовательными в своих делах, особенно тех, которые касаются вашей работы. В первой половине месяца также появится стремление расширить свои знания. Вы станете более любознательными и коммуникабельными, усилится тяга к общению. Во второй половине марта попробуйте проанализировать полученную информацию и новые знакомства и развить те, что показались вам наиболее интересными.', 'март 2012'),
(26, 2, 'Расположение планет в течение этого месяца может на время вернуть вас в прошлое. Возможно, напомнят о себе былые романтические связи и увлечения. Не исключены встречи с людьми из прошлого. Это время, особенно вторая половина месяца, подходит для анализа своего прошлого. Рекомендуется вспомнить приятные моменты, понять причины совершенных ошибок. В марте вы больше внимания, скорее всего, станете уделять своей внешности, появится стремление выглядеть более привлекательно и стильно. Это благоприятное время для того, чтобы поменять свой имидж: сделать новую прическу, сменить цвет волос или постараться стать более обаятельными в общении с окружающими людьми.', 'март 2012'),
(27, 3, 'Первая половина этого месяца принесет вам новые планы и идеи. Однако сейчас не стоит спешить их реализовывать, особенно в том случае, если они будут связаны с вашими домашними и семейными делами. Просто фиксируйте новые идеи, заводите единомышленников, присоединяйтесь к различным клубам по интересам. Во второй половине месяца увеличатся шансы на встречу с друзьями, с которыми вы длительное время не виделись. Ждите от них телефонных звонков, писем или сообщений в социальных сетях. Это также прекрасное время для того, чтобы еще раз обдумать свои планы на будущее, быть может, даже&nbsp; пересмотреть их, но не кардинально, а лишь уточнив различные детали.', 'март 2012'),
(28, 4, 'Первый месяц весны принесет улучшение отношений с друзьями и единомышленниками. Сейчас вы заметите, что эти связи приносят вам много позитивных эмоций. Общение с друзьями будет не только улучшать ваше настроение, но и добавлять удачливости в другие сферы жизни. Также вы сможете обзавестись новыми друзьями или просто окружите себя приятными людьми. В первой половине месяца, возможно, появятся новые цели в жизни или немного поменяются приоритеты. Для обдумывания этих изменений у вас будет вся вторая половина марта. В это время вы сможете спокойно поразмыслить о своих жизненных приоритетах, а также оценить, что вам уже удалось сделать в жизни и каким способом вы смогли этого достигнуть.', 'март 2012'),
(29, 5, 'В марте типичных представителей вашего зодиакального знака ждет удача в карьере. Сейчас вам многое будет удаваться заметно проще, чем вашим коллегам. Это время можно использовать для роста по карьерной лестнице, обсуждения повышения заработной платы с руководством. Во всех финансовых вопросах в течение этого периода стоит быть более последовательными и избегать необдуманных действий. Первая половина марта окажется удачным периодом для путешествий, особенно таких, что помогут расширить собственный кругозор. Во второй половине месяца не исключены некоторые сложности с обучением: новые знания усваивать станет несколько сложнее, чем обычно. Упор сейчас стоит сделать на повторении уже полученной информации.', 'март 2012'),
(30, 6, 'Расположение планет в марте указывает на возможность приятного путешествия. Его, правда, лучше запланировать на первую половину месяца, чтобы избежать различных задержек в пути. Этот период может также принести вам успехи в обучении. Не стоит пренебрегать возможностью научиться чему-либо в течение этого месяца, к тому же посещение курсов сейчас может стать для вас дополнительным источником знакомств с интересными и приятными людьми. Первая половина марта неплохо подходит для решения сложных интеллектуальных задач. Работа над ними сейчас окажется для вас весьма увлекательным процессом. Во второй половине месяца можно успешно отдавать долги.', 'март 2012'),
(31, 7, 'В марте вас ожидают новые возможности в области бизнеса и инвестиций. Сейчас вы сможете более успешно управлять своими проектами, появится возможность увеличить доходы. Март поможет вам и более удачно распоряжаться имеющимися у вас деньгами. Вы будете способны выбрать наиболее правильные направления для вложения собственных средств. Расположение планет также указывает на позитивные изменения в вашей интимной жизни. Она станет более чувственной, вы сможете получать и дарить больше нежности и тепла близкому человеку. В первой половине месяца не исключены интересные знакомства, как в личной, так и в деловой сфере. Это хорошее время для обсуждения проблем в отношениях. Вторая половина марта может принести возвращение к прежним договорам и деловым партнерам.', 'март 2012'),
(32, 8, 'Расположение планет в течение первого весеннего месяца сулит вам много приятного в личных отношениях. В существующих парах типичных Скорпионов ожидает больше нежности и гармонии. Это подходящее время для того, чтобы налаживать взаимоотношения с постоянным партнером. Одиноким Скорпионам сейчас не следует терять время. Наступило удачное время, в течение которого вы сможете встретить настоящую любовь и начать серьезные и продолжительные любовные отношения. В первой половине месяца также стоит найти время для интеллектуальной работы, больше внимания уделить своему здоровью. На работе во второй половине марта не рекомендуется начинать новые дела и проекты, более внимательно стоит относиться к своим обязанностям.', 'март 2012'),
(33, 9, 'Первый месяц весны принесет типичным Стрельцам удачу в профессиональной деятельности. Сейчас вам будет проще справляться со своими повседневными обязанностями. Если вам нравится ваша работа, то в этот период вы заметите увеличение производительности своего труда, если же работа не приносила удовольствия, то сейчас, скорее всего, вы станете относиться к ней с большим интересом. В течение этого периода будет проще справляться и с любыми домашними обязанностями. Первая половина месяца принесет больше возможностей для творческого самовыражения, особенно в интеллектуальной сфере. Во второй половине марта не исключены встречи с бывшими возлюбленными или более частые воспоминания о прошлых романтических связях.', 'март 2012'),
(34, 10, 'В течение марта у вас будет часто преобладать романтическое настроение. Козерогам, которые состоят в паре, сейчас больше времени стоит уделить отдыху вместе с любимым человеком, добавлению романтики в отношения и совместным развлечениям. Одиноким представителям этого знака стоит проявить немного инициативы: сейчас отличное время для новых знакомств и романтических свиданий. Но если вы будете сидеть дома, то нужный человек вряд ли сам постучится в вашу дверь. В первой половине марта вы сможете успешно решать внутрисемейные вопросы. Постарайтесь найти больше времени для общения с семьей. Во второй половине марта не рекомендуется начинать новые дела, лучше завершить реализацию прежних идей.', 'март 2012'),
(35, 11, 'Расположение планет в течение этого месяца говорит о том, что вы сможете отлично благоустроить свой дом. Правда, стоит быть чуть более последовательными в осуществлении своих планов. Чувство стиля и красоты, а также стремление создать комфорт в своей квартире не должны дать вам сбиться с верного пути. Этот период также будет благоприятен для налаживания внутрисемейных отношений, приема гостей. Это прекрасное время и для того, чтобы улучшить свои кулинарные навыки, порадовать гостей или близких новыми вкусными блюдами. Первая половина месяца принесет вам много общения и новой информации. Анализом полученных сведений лучше заниматься во второй половине марта.', 'март 2012'),
(36, 12, 'Этот месяц принесет большое количество общения, причем с теми людьми, которые будут вам симпатичным и приятны. Они могут быть притягательны для вас и в интимном плане, поэтому не исключен флирт и развитие легких романтических отношений. В первой половине месяца есть шанс отправиться в приятную поездку, которая принесет вам много новых впечатлений, а также интересных знакомств. В этот период также можно принимать некоторые решения в финансовой области, совершать необходимые покупки. Вторая половина марта менее удачна для материальных дел и начала новых проектов в коммерческой области.', 'март 2012'),
(37, 1, 'В апреле у типичных представителей вашего зодиакального знака успешно будут складываться короткие поездки. Сейчас они станут более приятными и могут принести новые знакомства. Однако в первой половине месяца старайтесь планировать любые путешествия более тщательно: невнимательность к мелочам в это время может привести к неприятным событиям. В работе в течение первой половины апреля не стоит приниматься за что-то новое. Потратьте это время на то, чтобы завершить ранее начатые дела и проекты. Активную работу в новых направлениях лучше вести во второй половине месяца. В это время вы также сможете более прямо и открыто выражать свою точку зрения, благодаря чему многие из ваших инициатив будут услышаны и рассмотрены.', 'апрель 2012'),
(38, 2, 'Типичных Тельцов в апреле ждет удача в финансовой области. Сейчас вы сможете принимать решения, которые принесут дополнительные доходы. Это время можно считать весьма удачным для совершения покупок, особенно вторую половину месяца. В начале апреля лучше все же планировать приобретения более тщательно, а также внимательнее относиться к выбору товаров. В этот период вас ждет немало встреч с людьми из прошлого. Это могут быть старые друзья или прежние возлюбленные. Вторая половина апреля принесет новые и весьма перспективные романтические знакомства, а также заставит больше внимания обратить на свой внутренний мир.', 'апрель 2012'),
(39, 3, 'Апрель принесет приятные обновления в вашу жизнь. Вам захочется меняться в лучшую сторону, что приведет к переменам во внешнем облике, а затем и к изменениям в своем поведении. Вы станете приветливее, обаятельнее, чем привлечете к себе множество людей. Не исключены романтические знакомства, основанные на общих увлечениях. В домашних делах активность будет также высокой. В первой половине апреля желательно доделать все, что вы в свое время не завершили. Тогда в конце месяца у вас появится время и возможность активно решать новые возникшие вопросы, связанные с работой или домом.', 'апрель 2012');
INSERT INTO `forecasts` (`id`, `signId`, `forecast`, `forecastDate`) VALUES
(40, 4, 'Расположение планет в апреле указывает на то, что для вас будут важны внутренние переживания, особенно в сфере личных отношений. Сейчас не исключено появление новых чувств, которые вы, возможно, захотите скрыть. Возможны тайные любовные романы. Месяц хорошо подходит и для приятного отдыха. Развлечения будут содействовать быстрому восстановлению сил и жизненной энергии. На первую половину апреля не рекомендуется планировать поездки: различные мелочи могут их испортить. Вторая половина месяца больше подходит для путешествий, а также позволит вам глубже осознать и обдумать свои жизненные цели и приоритеты, улучшить репутацию в обществе.', 'апрель 2012'),
(41, 5, 'В апреле типичных Львов ждет удача в сфере взаимоотношений с друзьями и единомышленниками. Они станут более гармоничными, вы сможете почувствовать поддержку со стороны своих соратников. Возможны и новые знакомства с людьми, большинство которых будут не только разделять ваши взгляды, но и вызывать симпатию. Этот месяц также хорошо подходит для построения новых планов, в том числе и в личной жизни. В первой половине апреля рекомендуется скорректировать свое отношение к деньгам. Вторая половина месяца подходит для обучения и дальних поездок. В этот период вы также сможете начать смелые проекты в финансовой области.', 'апрель 2012'),
(42, 6, 'В апреле звезды сулят типичным Девам успех в карьере и профессиональной деятельности. Ваша деловая репутация будет расти, получится наладить взаимоотношения с влиятельными людьми. Удача ждет Дев и в вопросах достижения поставленных перед собой целей и задач. Первая половина месяца может привести к повторению некоторых ситуаций из прошлого в сфере личных и деловых отношений. Попробуйте глубже разобраться в них, понять скрытые мотивы вовлеченных в события людей. Во второй половине апреля вы почувствуете большой прилив сил, который также усилит ваше желание к серьезным переменам в жизни. Но помните о том, что многие из принятых сейчас решений отменить будет уже невозможно.', 'апрель 2012'),
(43, 7, 'Расположение планет в апреле сулит типичным представителям вашего зодиакального знака удачу в обучении. У вас усилится тяга к новым знаниям, поэтому это благоприятный период для прохождения курсов и семинаров. Также вас могут ждать интересные знакомства с симпатичными вам людьми во время обучения или в различных образовательных центрах и учреждениях. В первой половине апреля также стоит приложить активные усилия для изучения своего внутреннего мира, решения накопившихся проблем. Не исключено, что для этого вам придется совершить экскурс в прошлое. Вторая половина месяца откроет перед вами новые перспективы в личных и деловых взаимоотношениях.', 'апрель 2012'),
(44, 8, 'Типичным Скорпионам в апреле звезды сулят изменение жизненных ценностей. Весьма вероятно, что перемены сейчас будут связаны с новой картиной мира, которая сложится у вас в голове, и полным отказом от прежних приоритетов. Первая половина апреля также принесет встречи со старыми друзьями. Во время общения старайтесь больше интересовать последними новостями из их жизни. Возможно, кто-то из друзей предложит вам выгодное сотрудничество. Вторая половина месяца позволит добиться успеха в интеллектуальной работе и завести новых активных соратников.', 'апрель 2012'),
(45, 9, 'В апреле типичных Стрельцов ждет удача в личных отношениях. Если вы уже состоите в паре, то в апреле между вами и любимым человеком воцарится гармония и взаимопонимание. Одиноким Стрельцам этот месяц сулит новые интересные знакомства. Ваше окружение пополнится симпатичными людьми, либо вы измените свое отношение к кому-то из старых знакомых. В первой половине месяца стоит приложить активность для достижения целей, к которым вы стремились раньше, но которых не смогли добиться. Сейчас за короткий срок можно успеть многое исправить. Во второй половине месяца вас будет ждать успех в интеллектуальном творчестве.', 'апрель 2012'),
(46, 10, 'Успех ожидает типичных представителей вашего зодиакального знака в работе. Сейчас в этой сфере будут чаще происходить приятные для вас события, общение с коллегами и подчиненными станет приносить положительные эмоции. Если вы находитесь в поисках подходящей должности, то в этот период, скорее всего, найдете работу, которая будет лучше вписываться в вашу систему ценностей и приносить больше психологического комфорта. Первая половина месяца окажется не слишком удачной для приобретения новых знаний. Это время, скорее, подходит для усвоения и переработки уже полученной информации. Вторая половина апреля поможет успешно решать домашние дела. В этот период стоит больше времени посвящать общению с родственниками.', 'апрель 2012'),
(47, 11, 'Расположение планет в апреле сулит вам немало романтики. У вас появится больше возможностей для начала нового любовного романа, более интересными и удачными окажутся романтические свидания. Не исключено, что у вас несколько изменится и само отношение к любви: вы станете больше ценить романтику, немаловажное значение станете уделять интимным отношениям. Дети также будут радовать вас своими успехами. Если детей у вас еще нет, то, возможно, появится или усилится желание их завести. В первой половине апреля не стоит рисковать и вносить резкие перемены в свою жизнь. Вторая половина месяца принесет больше активности в интимную жизнь, а также увеличит количество общения и коротких поездок.', 'апрель 2012'),
(48, 12, 'Типичным Рыбам в апреле звезды сулят удачу в домашних делах. Сейчас наступает прекрасное время для того, чтобы сделать свой дом более уютным. Для этого будет достаточно и средств, и желания, и чувства стиля, которое поможет вам в итоге сделать из своей квартиры настоящий предмет искусства. Этот месяц благоприятен и для приема гостей, налаживания взаимоотношений с близкими родственниками. В первой половине апреля воздержитесь от заключения деловых контрактов: для этого лучше подойдет вторая половина месяца. В этот период также появится возможность заработать больше денег, используя свои интеллектуальные способности.', 'апрель 2012'),
(49, 1, 'Типичных Овнов в мае ждет много активности в работе. Используя свою энергичность и напористость, вы сможете легко справиться с текущими обязанностями, а также начать новые проекты. Первая половина мая принесет много общения, в основном с приятными для вас людьми. Успешно будут складываться короткие поездки, во время которых не исключены приятные знакомства, в том числе романтического характера. Общение с деловыми целями также пройдет весьма продуктивно. Во второй половине мая совершать поездки уже нежелательно. Они могут оказаться более длительными, чем вы планировали, и чуть менее результативными.', 'май 2012'),
(50, 2, 'Первая половина месяца у типичных Тельцов будет довольно удачной. Вы сможете открыто проявлять свои способности и таланты. Удача ждет вас в финансовой области. Возможно увеличение доходов, а также совершение выгодных покупок. Во второй половине мая появится стремление проанализировать внутренний мир, понять причины изменений в своем поведении. В это время будет не так легко принимать решения. Нередко они будут непоследовательными, особенно если касаются финансовых вопросов. Вы не всегда сможете открыто и непринужденно проявлять свои истинные черты характера. Не исключено, что использовать собственные таланты вы сможете лишь для внутреннего развития, а не для демонстрации окружающим. Май принесет активность в творчестве. Также, скорее всего, вы станете более напористыми в личной жизни.', 'май 2012'),
(51, 3, 'Расположение планет в мае указывает на активный период в домашних делах. У вас появится шанс посвятить больше времени обустройству собственного жилья. Скорее всего, вы проявите энергичность и продемонстрируете высокую производительность труда. Также вы станете более активными в решении семейных вопросов. К вашему мнению будут прислушиваться, вряд ли какое-либо решение в семье будет принято без вашего участия. Первая половина месяца принесет возможность открыто проявлять свое обаяние. Это неплохое время для того, чтобы что-то изменить в своем внешнем виде. Во второй половине месяца появится склонность к анализу собственного поведения, а также отношения к вам окружающих людей.', 'май 2012'),
(52, 4, 'В мае типичных представителей вашего зодиакального знака ожидает много поездок. Возможно, вы просто станете чаще ездить на своей машине или на общественном транспорте. Но может, предпримите и путешествия на дальние расстояния. Увеличится интенсивность общения. Сейчас оно будет проходить более активно, открыто, при этом появится склонность к спорам, жарким дискуссиям. Первая половина мая может принести тайную романтическую привязанность или платоническую влюбленность. Скорее всего, вам будет наиболее комфортно в одиночестве, оставаясь наедине с собой. Во второй половине месяца не исключены встречи с бывшими возлюбленными. Есть вероятность возникновения между вами тайных любовных отношений.', 'май 2012'),
(53, 5, 'Расположение планет в мае указывает на высокую активность в финансовой сфере. В течение этого месяца вы сможете больше зарабатывать. Но также возрастут и ваши расходы, поскольку тратить деньги вы станете более энергично. Это время подходит для принятия смелых, но при этом продуманных решений в финансовой области. Первая половина месяца принесет больше теплоты и гармонии в отношениях с друзьями. Также у вас могут появиться новые знакомые и единомышленники. Вторая половина мая, скорее всего, будет характеризоваться более запутанными отношениями с противоположным полом. Если у вас когда-то была романтическая симпатия к другу, то сейчас она вновь может проявиться.', 'май 2012'),
(54, 6, 'Этот месяц будет ознаменован вашей повышенной активностью, смелостью и решительностью. Сейчас вы многое сможете делать быстро, причем настолько, что окружающим останется лишь удивляться, как вы умудряетесь столько успевать. Постарайтесь использовать этот период для созидательной деятельности, найдите применение своей энергии. Рекомендуется больше заниматься спортом, особенно если хотите к лету подкорректировать свою фигуру. Сейчас достижение быстрых результатов вполне возможно. В первой половине месяца станет проще достигать своих целей: обстоятельства во многом будут способствовать этому. Во второй половине мая не исключено переосмысление своих жизненных ориентиров.', 'май 2012'),
(55, 7, 'Первая половина месяца может принести приятные путешествия и общение с иностранцами. Повышается вероятность завязывания курортных романов. Расположение планет в мае указывает на удачный период для активного отдыха. Если вы планируете отпуск на начало месяца, то рекомендуется отдать предпочтение заграничным странам. Вторая половина мая благоприятна для встреч с людьми, с которыми вы когда-то учились вместе. Обстоятельства могут снова сблизить вас, не исключено возобновление отношений. В этот период вам чаще могут требоваться знания, которые вы немного подзабыли. Сейчас желательно повторение пройденного материала. Это значительно расширит картину вашего мировоззрения.', 'май 2012'),
(56, 8, 'Расположение планет в течение этого месяца сделает ваше взаимодействие с друзьями и единомышленниками более интенсивным и динамичным. Не исключено появление чувства соперничества, но, скорее всего, оно будет лишь стимулировать отношения и ваше стремление к развитию. В течение этого месяца вы можете заметить, что активнее проявляете себя в окружении людей, разделяющих ваши взгляды на жизнь. Положение планет также указывает на стремление отстаивать интересы той группы или коллектива, частью которого вы являетесь. Первая половина мая принесет гармонию в интимные отношения, обострит чувственность. Вторая половина месяца может напомнить вам о давних эротических фантазиях, а также создать обстоятельства для их воплощения в реальность.', 'май 2012'),
(57, 9, 'В течение этого месяца вы сможете достигать своих целей благодаря смелости, прямоте и решительности. Сейчас не стоит бояться говорить прямо о своих планах. Ясность вашей мотивации будет полезна как для вас самих, так и для окружающих людей. Проявите больше активности, тогда вы сможете многого добиться в течение этого периода. Первая половина мая принесет гармонию в личные отношения. Скорее всего, они будут складываться ровно, возрастет доверие по отношению к любимому человеку. Это время подходит для начала нового романа. Во второй половине месяца лучше прояснять отношения с бывшими возлюбленными. Не исключено, что между вами вновь возникнет взаимное притяжение. Но не спешите с возобновлением связи: скорее всего, это явление окажется временным.', 'май 2012'),
(58, 10, 'Расположение планет в мае способствует расширению мировоззрения, получению новых знаний, проведению экспериментов. Сейчас вас может заинтересовать философия, религия или традиции других народов. Это неплохое время для обучения и путешествий, особенно по тем местам, где вы ранее никогда не бывали. Первая половина месяца принесет успех в карьере. Это удачное время для поиска новой работы. Во второй половине мая ваше продвижение по карьерной лестнице может, наоборот, приостановиться, особенно в том случае, если у вас есть какие-либо недоделанные проекты. Сейчас они будут чаще напоминать о себе.', 'май 2012'),
(59, 11, 'Этот месяц у типичных представителей вашего зодиакального знака прекрасно подходит для того, чтобы осуществить серьезные изменения в своей жизни. Наступило время перемен. Решительность и готовность к тому, что многие изменения окажутся необратимыми, позволит вам совершить смелые поступки. Первая половина месяца удачна для начала нового романа, налаживания взаимоотношений со своими детьми или просто для творческой деятельности, как в одиночестве, так и в компании любимого человека. Вторая половина месяца может принести возврат к прежним увлечениям, как творческим, так и романтическим.', 'май 2012'),
(60, 12, 'В течение этого месяца повысится активность в сфере романтических и деловых отношений. В личной жизни появится больше динамики и страсти, но в то же время не исключена борьба за власть в паре. Возможно, вам станет сложнее уступать любимому человеку в чем-либо. Вы сможете открыто обсуждать многие проблемы в отношениях, но старайтесь делать это не слишком агрессивно и напористо. В деловом партнерстве также может возникать больше споров, но отношения между тем будут более прозрачными. Сейчас вы вряд ли будете терпеть интриги со стороны деловых партнеров и предпочтете сразу расставить все точки над i. Первая половина мая хорошо подходит для создания уюта в своем доме. Во второй половине месяца лучше не начинать ничего нового.', 'май 2012'),
(61, 1, 'В течение июня встречи со старыми знакомыми, одноклассниками и в целом любыми людьми из вашего прошлого станут более частыми. Этот месяц может принести возобновление общения с ними, а сами отношения станут довольно теплыми. Не слишком удачными в июне окажутся короткие поездки: нередко они будут проходить с задержками. Сейчас есть также риск упустить важные детали при подготовке к путешествию по причине рассеянности и невнимательности. Высокая активность сохранится в сфере работы. В течение первого месяца лета вы сможете справляться со своими обязанностями так же быстро и энергично. Звезды советуют более активно взаимодействовать с коллегами по работе и заниматься решением бытовых вопросов.', 'июнь 2012'),
(62, 2, 'Расположение планет в течение этого месяца указывает на то, что вы станете чаще проявлять непоследовательность в решении финансовых вопросов. Сейчас не рекомендуется заниматься вложениями, это время больше подходит для возврата долгов или фиксации прибыли от сделанных ранее инвестиций. Крупных расходов планировать на июнь также не рекомендуется, так как уже через некоторое время они могут оказаться не столь необходимыми, как кажется сейчас. Этот месяц позволит вам активно проявить себя в творчестве. Это неплохое время для самовыражения. Повысится активность и в романтической сфере, но новые отношения завязать будет не так просто, как вам бы хотелось.', 'июнь 2012'),
(63, 3, 'Первый летний месяц принесет вам больше мыслей и внимания к своему внешнему виду. Сейчас можно сделать небольшие изменения в своем стиле, но лишь в том случае, если вы давно готовились к этому. Если же идеи относительно перемен во внешности пришли совсем недавно или только придут в течение этого периода, не спешите воплощать их в жизнь. В этом случае, увы, не исключено, что перемены не пойдут вам на пользу. В течение июня вы сможете более активно решать любые домашние и семейные вопросы. А вот отделочные работы менее желательны, особенно те, где требуется дизайнерская мысль и чувство стиля и красоты. Могут прийти новые мысли относительно управления личными финансами, но сейчас стоит ограничиться сбором информации, а не конкретными действиями.', 'июнь 2012'),
(64, 4, 'Тайные любовные романы, возврат к прежним любовным и романтическим отношениям, а также анализ прошлых отношений - такие темы будут весьма актуальными в июне для типичных представителей вашего зодиакального знака. Сейчас вы можете обнаружить, что у вас остались чувства к своим бывшим возлюбленным, и, возможно, захотите прояснить эти моменты. Не исключено, что вы захотите восстановить прошлые отношения и вновь испытать разочарование лишь с той целью, чтобы понять, что все уже кончено. Этот месяц также принесет вам больше поездок, прямоты&nbsp; в общении по деловым вопросам. Вы также станете более любознательными и сможете активно развивать свою эрудицию.', 'июнь 2012'),
(65, 5, 'Взаимоотношения с друзьями, особенно с подругами, в течение этого периода станут более запутанными. Сейчас велика вероятность встреч с давними приятелями, с которыми вы не общались длительное время. Немного сложнее будет мужчинам-Львам: дружеские отношения с противоположным полом могут часто смешиваться с романтикой и флиртом, в своих желаниях вы станете менее последовательными, чем рискуете запутать ситуацию. Это неплохое время для возврата в круг единомышленников, к прежним увлечениям и интересам. Активность также будет наблюдаться в финансовых вопросах. Сейчас вы сможете более активно зарабатывать деньги, но и ваши расходы станут более интенсивными.', 'июнь 2012'),
(66, 6, 'Этот месяц будет довольно активным. Сейчас вы сможете чаще проявлять инициативу, принимать смелые решения. Это время благоприятно для занятий спортом и любой физической активности, а также деятельности, требующей энергичности и умения принимать самостоятельные решения. А вот в работе и карьере дела могут идти не так хорошо, как бы хотелось. Чаще будут всплывать вопросы из прошлого, связанные с вашей работой. Если у вас накопился положительный опыт, то этот период может оказаться удачным, если же вы что-то не успели доделать вовремя, то сейчас придется вернуться к решению этих вопросов. Вы сможете также рассчитывать на помощь друзей и единомышленников, которых у вас, скорее всего, станет чуть больше.', 'июнь 2012'),
(67, 7, 'Расположение планет в течение этого месяца указывает на то, что вам могут потребоваться знания, которые вы получили некоторое время назад. В принятии решений сейчас стоит чаще обращаться к своему жизненному опыту. Не рекомендуется планировать на это время поездки за границу: из-за различных обстоятельств они могут оказаться хлопотными. В течение июня вы сможете чаще обдумывать свои жизненные цели, расставлять новые приоритеты или даже заслужите известность благодаря общительности или ораторскому искусству. Но стоит помнить, что сейчас максимальный прилив сил и энергии будет наблюдаться в те периоды, когда вы находитесь наедине с собой.', 'июнь 2012'),
(68, 8, 'Этот месяц окажется удачным для возврата долгов и кредитов. В течение этого периода не рекомендуется занимать деньги или, напротив, вкладывать их куда-либо. В последнем случае риск повышается, если вы будете оперировать уже не своими, а чужими деньгами. Июнь также принесет вам любознательность и легкость в усвоении новых знаний. Удача будет ждать вас в общении с иностранцами и жителями других городов. Отношения с друзьями станут более открытыми и динамичными, не исключено появление смелых планов на будущее. Усилится стремление защищать интересы той группы людей, к которой вы принадлежите.', 'июнь 2012'),
(69, 9, 'Положение планет в июне может обнажить проблемы в отношениях, которые вы предпочитали не замечать. Не исключена активация каких-либо прошлых отношений, повышается вероятность встреч с бывшими пассиями. Все это будет явным намеком на то, что вам стоит обернуться назад, прежде чем продолжить свое движение вперед. Проанализируйте свои ошибки, поймите причины прошлых расставаний. В этом случае в ближайшем будущем вы сможете строить отношения более эффективно. В карьере продолжайте быть активными и напористыми. Добивайтесь продвижения собственных проектов, активно завоевывайте деловую репутацию. Между тем новые деловые связи сейчас станет заводить сложнее, чем обычно.', 'июнь 2012'),
(70, 10, 'В работе в течение этого периода не исключены завалы. Скорее всего, работы станет больше из-за тех дел, которые вы в свое время не завершили. Именно ими и стоит заняться в первую очередь, так как без этого дальнейший прогресс будет практически невозможным. Возможно, вам потребуются и новые знания. Для обучения, а также для самостоятельного изучения каких-либо предметов сейчас наиболее благоприятное время. Чуть проще вы сможете в июне заводить новые деловые отношения. Используйте свою общительность и владение нужной информацией. Это неплохое время для заключения предварительных соглашений, обсуждения общих вопросов.', 'июнь 2012'),
(71, 11, 'Встречи с бывшими пассиями весьма вероятны у типичных представителей вашего зодиакального знака в июне. Однако это лишь сигнал к тому, чтобы проанализировать былые связи и не повторять совершенных ошибок в будущем. Сейчас не исключено возобновление отношений, но, скорее всего, лишь на короткое время. Также сейчас можно решать вопросы, связанные с вашим творчеством. Вас могут вновь заинтересовать прежние увлечения и давние способы самореализации. В работе стоит чаще принимать решения и анализировать информацию. Общение с коллегами будет более насыщенным и полезным для принятия важных решений. Этот месяц также благоприятен для прохождения любых видов медицинских обследований.', 'июнь 2012'),
(72, 12, 'Расположение планет в июне указывает на благоприятное время для решения вопросов, связанных с домом и семьей. Сейчас можно доделывать ранее начатый ремонт, решать вопросы обустройства собственного жилья. Не рекомендуется в этот период начинать новые дела, стоит приложить усилия к доделыванию всего того, что уже было начато. В отношениях сейчас появится больше динамики. Одинокие Рыбы почувствуют стремление к флирту, которое может привести к легким знакомствам и романтическим свиданиям. Сейчас есть большая склонность к повторению прежних ошибок в новых отношениях. А поэтому завязывать новые романы стоит лишь в том случае, если вы уже попрощались со своим прошлым окончательно.', 'июнь 2012'),
(73, 1, 'Активность ожидает типичных Овнов в сфере личных отношений. Сейчас вы сможете открыто решать многие вопросы, станете более напористыми. Не исключено, что и ваш партнер также будет проявлять повышенную активность. Старайтесь добавить прямоты и динамики в отношения, но избегать соперничества и борьбы за власть. Удачу сулят вам звезды в коротких поездках, которые наиболее благоприятно будут складываться в первой половине месяца. Поездки с целью отдыха и получения новых впечатлений будут удачны в течение всего июля, но во второй половине месяца чаще могут случаться различные накладки. Романтики будет больше в первой половине июля. Во второй половине месяца не исключены встречи с бывшими возлюбленными.', 'июль 2012'),
(74, 2, 'Расположение планет в июле будет благоприятно для решения финансовых вопросов. Сейчас вы сможете улучшить свое материальное положение благодаря усилиям со своей стороны и доли удачи, которая будет вам сопутствовать. Это период совершения удачных и приятных покупок, легкого получения более высокой прибыли. Повысится также стремление к комфорту и роскоши. Июль обещает жаркую пору в работе. Сейчас вам предстоит работать более энергично, чем обычно. Сил и энергии для этого будет достаточно. Ремонтные работы в своем доме лучше планировать на первую половину месяца. Это также хорошее время для решения внутрисемейных вопросов и проведения сделок с недвижимостью. Продавать или покупать квартиру, оформлять связанные с ней документы во второй половине месяца нежелательно.', 'июль 2012'),
(75, 3, 'Этот месяц принесет возможность раскрыть собственное обаяние и найти свой индивидуальный стиль. Сейчас усилится ваше стремление ко всему прекрасному, вам захочется, чтобы все, что вас окружало, было красивым. Удача будет сопутствовать вам в личных начинаниях, а также в любых переменах, связанных с вашим имиджем. В романтических отношениях в июле вы станете более решительными и напористыми. Сексуальные связи станут особенно важны. Скорее всего, вы проявите больше активности в личной жизни, чаще будете действовать смелее и проявлять инициативу. Это время также отлично подходит для занятий спортом и участия в спортивных состязаниях. Первая половина июля благоприятна для коротких поездок, вторая половина месяца - для решения давних вопросов в своем ближайшем окружении.', 'июль 2012'),
(76, 4, 'Июль поможет вам быть активнее в делах, связанных с вашим домом и недвижимым имуществом. Сейчас можно активно делать ремонт собственными силами или более настойчиво отстаивать свои права на тот или иной объект недвижимости. Между тем не исключены конфликты во взаимоотношениях с близкими родственниками и членами семьи. Не исключено, что вы будете более открыто гнуть свою линию, действовать так, как удобно вам. Не будьте в своих действиях слишком агрессивными по отношению к близким. Потребность в уюте, а порой и в некотором уединении также может присутствовать в это время. Это подходящий период для отдыха в уединенном месте. В решении финансовых вопросов старайтесь большую часть решений принимать в первой половине июля, вторая половина месяца больше подходит для анализа своего материального положения.', 'июль 2012'),
(77, 5, 'В июле ваши взаимоотношения с друзьями и единомышленниками станут более теплыми и гармоничными. Это отличный период для того, чтобы забыть про старые обиды и чаще проводить вместе свободное время. Июль также принесет вам новые знакомства, которые впоследствии перерастут в дружеские. В этом месяце вас также ждет чуть больше поездок, чем обычно. В общении, скорее всего, вы станете более открытыми и напористыми, будете активнее отстаивать собственное мнение. В первой половине месяца вы также почувствуете усиление любознательности, это хорошее время для развития эрудиции. Во второй половине июля получится глубже анализировать свое поведение.', 'июль 2012'),
(78, 6, 'Расположение планет в июле указывает на возрастание вашей активности в финансовых делах. Сейчас вы будете более активны в заработке денег, но станете и более расточительными и импульсивными в своих тратах. Это неплохое время для начала смелых проектов в финансовой сфере. Усиливается также тяга к отстаиванию своих жизненных принципов и активное им следование. В карьере удача будет сопутствовать вам, помогая добиваться поставленных перед собой целей и задач. В первой половине месяца чаще используйте свою интуицию. Обдумывание планов и идей в одиночестве в это время будет эффективным. Также более производительным станет ваш интеллектуальный труд, если вы создадите спокойную обстановку вокруг себя. Вторая половина июля будет чаще приносить различные воспоминания из вашего прошлого.', 'июль 2012');
INSERT INTO `forecasts` (`id`, `signId`, `forecast`, `forecastDate`) VALUES
(79, 7, 'Этот месяц принесет типичным представителям вашего зодиакального знака больше энергичности. Вы заметите, что ваши силы стали возрастать, а продуктивность труда - усиливаться. Сейчас вы как никогда способны на принятие смелых решений, вам будет проще делать выбор, проявлять свою напористость и активность. Это хороший период для занятий спортом, сейчас физические упражнения быстрее дадут нужный результат. Этот месяц также принесет вам тягу к личному развитию, не исключены перемены в мировоззрении, усиление интереса к культуре других народов. Месяц благоприятен для путешествий, особенно его первая половина. Во второй половине июля участятся встречи со старыми друзьями.', 'июль 2012'),
(80, 8, 'Июль принесет вам повышение активности в личных отношениях, особенно в сексуальной сфере. У вас появится больше возможностей для того, чтобы раскрыть свою чувственность и максимально насладиться отношениями. Вопросы, связанные с кредитами и чужими деньгами, в течение июля вы также сможете решать более успешно. В этом месяце активизируется стремление к познанию своего внутреннего мира. Может возрасти интерес ко всему таинственному и непознанному. В первой половине месяца у вас также могут появиться новые цели. Успех в их реализации сейчас во многом будет зависеть от вашего владения нужной информацией. Вторая половина июля станет важным периодом для корректировки ваших целей и изменений в жизненных приоритетах.', 'июль 2012'),
(81, 9, 'Расположение планет в июле указывает на активное стремление к реализации собственных планов. В течение этого периода более динамичными станут ваши взаимоотношения с друзьями и единомышленниками, вы сможете более открыто выражать свое мнение в кругу друзей. Приятные события могут произойти и в личной жизни. Одинокие Стрельцы смогут встретить настоящую любовь и начать серьезные отношения. В существующих союзах Стрельцов ждет период гармонии и счастья. Это неплохое время для укрепления своих отношений. В первой половине июля благоприятно сложатся дальние поездки, а вот планировать путешествия на вторую половину месяца не рекомендуется.', 'июль 2012'),
(82, 10, 'В июле вы сможете активно и динамично добиваться своих целей. Сейчас успех будет во многом зависеть от вашей напористости, смелости и решительности, особенно если речь идет о карьерных достижениях. Полезными качествами будут также открытость и&nbsp; прямота. А вот в отношениях с коллегами и подчиненными, напротив, стоит проявлять больше обаяния. Не исключено, что в течение этого месяца в вашем рабочем окружении появятся симпатичные люди, в связи с чем повышается вероятность служебных романов. В течение первой половины июля вы также сможете успешно решать вопросы, связанные с наследством, налогами, алиментами. Новые вложения во второй половине июля делать нежелательно. Это время больше подходит для возврата долгов.', 'июль 2012'),
(83, 11, 'Расположение планет в июле указывает на удачное время для активного обучения или самостоятельного изучения чего-либо. Не менее удачным способом расширить свой кругозор станут путешествия, желательно в дальние страны, за границу, в места, где ранее вы не бывали. Выбирайте активный отдых. Положительные события ждут вас и в романтической сфере. В течение июля любовные свидания будут происходить чаще, есть большая вероятность завязывания курортных романов. В существующих отношениях стоит уделить больше времени романтике и поиску общих интересов. Давние проблемы отношений лучше разбирать во второй половине июля.', 'июль 2012'),
(84, 12, 'В течение этого месяца вы сможете посвящать много времени благоустройству собственного жилья. Можно начинать ремонт или вести отделочные работы, облагораживать территорию перед домом, особенно если она принадлежит вам. Ваше чувство стиля и красоты, стремление к комфорту помогут вам в таких начинаниях. Также удастся наладить взаимоотношения со своими родственниками, особенно если ранее вы находились в ссоре. В течение этого месяца стоит избегать безрассудных поступков, смелость будет помогать вам, но лишь до тех пор, пока не толкнет на неоправданный риск. В первой половине июля постарайтесь решать рабочие вопросы. Во второй половине месяца, возможно, придется уделить время исправлению совершенных ранее ошибок в делах.', 'июль 2012'),
(85, 1, 'Расположение планет в августе сулит вам удачу в решении внутрисемейных вопросов. Появится больше понимания и гармонии в отношениях с близкими родственниками и членами семьи. Это удачное время для того, чтобы заниматься благоустройством своего жилища, делать его более комфортным, красивым и стильным. Высокую активность вы также сможете проявить в личных отношениях. Но следите за тем, чтобы действия были продуктивными, а не приводили к конфликтам в отношениях. В первой половине месяца не исключены встречи с бывшими возлюбленными. Вторая половина августа принесет больше романтики и увеличит вероятность новых знакомств.', 'август 2012'),
(86, 2, 'Август принесет типичным представителям вашего зодиакального знака больше приятного общения. Сейчас вы чаще сможете оказываться в компании людей, общество которых вам приятно и интересно. Этот месяц также позволит обрести новых друзей и знакомых, у вас будет больше возможностей не только для приятного общения, но и для флирта. Во второй половине августа успешно будут складываться короткие поездки, они станут для вас источником удовольствия и приятных впечатлений. Месяц принесет также высокую активность в работе. Сейчас, возможно, понадобится более энергично справляться со своими обязанностями. Открытые и честные отношения с коллегами положительно отразятся на производительности вашего труда.', 'август 2012'),
(87, 3, 'Успех в августе ожидает типичных Близнецов в финансовой сфере. Сейчас ваше материальное положение улучшится, доходы возрастут, вы сможете совершать больше приятных покупок. Месяц также благоприятен для заключения финансовых сделок, поиска способов лучшего управления собственными сбережениями. Не исключено, что вы станете более напористыми в отношениях с противоположным полом. Мужчины-Близнецы будут активнее проявлять инициативу, а женщины-Близнецы будут чаще привлекать внимание противоположного пола.', 'август 2012'),
(88, 4, 'Последний летний месяц принесет типичным Ракам стремление позаботиться о своей внешности. Это благоприятное время для отдыха на пляже, посещения косметического салона, различных оздоровительных процедур. Также это подходящий период для перемен в своем имидже, обновления гардероба. Высокая активность ждет вас и в вопросах, связанных с домом, принадлежащим вам недвижимым имуществом. Это хорошее время для строительства, проведения ремонта собственными силами. А вот отношения с родственниками хоть и станут более динамичными, но все же могут оказаться и более конфликтными. Старайтесь сейчас не провоцировать ссор внутри своей семьи.', 'август 2012'),
(89, 5, 'В августе у типичных Львов усилится стремление к приятному отдыху, релаксации. Это один из лучших месяцев для отпуска. Большое количество работы сейчас будет вам в тягость. В это время стоит больше времени проводить на природе, в окружении близких людей. Возможно, вам захочется уединения. В общении в этот период появится больше прямолинейности. Старайтесь сейчас тщательно анализировать то, что хотите сказать: это поможет избежать бестактности. Месяц может принести немало поездок. Во время таких небольших путешествий стоит избегать спешки и быть более осторожными, бдительными.', 'август 2012'),
(90, 6, 'Общение с друзьями и единомышленниками, а также участие в каких-либо коллективных мероприятиях будет в августе весьма уместно. В это время не исключено расширение круга ваших знакомств, в том числе романтического характера. Высокая активность ждет вас в финансовой сфере. Сейчас вы сможете более активно зарабатывать деньги, но скопить что-то или отложить какую-то часть капитала на будущее вряд ли получится. Скорее всего, это будет связано с увеличением расходов. В финансовых вопросах сейчас будет приветствоваться решительность, напористость и открытость.', 'август 2012'),
(91, 7, 'В течение этого месяца вы станете более активными и напористыми, причем настолько, что можете и сами удивляться своему поведению. Важно использовать возросшую жизненную энергию продуктивно и созидательно, а не растрачивать ее на ссоры. Этот месяц поможет вам научиться быстрее делать выбор, отказывать напористым людям. В это время вы сможете эффективно заниматься спортом и добиваться неплохих результатов. В достижении своих целей потребуется обаяние. Сейчас стоит налаживать взаимоотношения с начальством, руководством, влиятельными людьми. Фортуна на вашей стороне, нужно лишь приложить некоторые усилия, чтобы использовать открывающиеся возможности.', 'август 2012'),
(92, 8, 'Расположение планет в августе принесет вам удачу в обучении. Сейчас усваивать новые знания будет заметно проще. Это хорошее время для приобретения нового жизненного опыта. Вторая половина августа станет отличным периодом для дальних путешествий. У вас появится возможность побывать за границей, усилится желание посетить страны, в которых ранее вы не бывали. При этом в августе вы вряд ли будете отличаться высокой активностью. Скорее всего, потребуется больше времени на восстановление сил и жизненной энергии. Планировать начало новых проектов рекомендуется в конце августа.', 'август 2012'),
(93, 9, 'Август принесет типичным Стрельцам больше энтузиазма в осуществлении собственных планов и проектов. У вас появится больше идей, воплотить которые вы сможете в короткие сроки. Вы станете смелее и напористее не только в своих планах, но и в их осуществлении. Динамичнее станут дружеские отношения, ваши друзья и единомышленники в это время будут стимулировать вашу активность самыми разными способами. Месяц принесет больше чувственности в близкие отношения. Положение планет говорит о возможности достижения гармонии в интимной сфере.', 'август 2012'),
(94, 10, 'Положение планет в августе благоприятно отразится на вашей личной жизни. Отношения в это время станут более ровными и гармоничными, чувства между вами и второй половинкой укрепятся. Новые отношения, завязанные в это время, могут перерасти в длительный и крепкий союз. Именно по этой причине стоит внимательнее присмотреться к новым людям противоположного пола, которые появятся в вашей жизни в это время. В достижении своих целей в августе вам поможет смелость и решительность. Уверенность в своей победе и активное стремление к успеху могут оказаться решающими факторами в достижении цели. Важно лишь четко понимать, к чему вы стремитесь, и прилагать энергию в нужном направлении без излишней агрессии.', 'август 2012'),
(95, 11, 'Активное стремление к новым знаниям и новому жизненному опыту будет характерно в августе для типичных представителей вашего зодиакального знака. Это может выражаться в стремлении к путешествиям, приключениям, обучению или даже научным исследованиям и экспериментам. Такая активность с вашей стороны принесет плоды в виде некоторых изменений в вашей системе мировоззрения. Довольно успешной станет сфера быта. Сейчас вы не только сможете улучшить свои бытовые условия и решить многие вопросы по хозяйству, но и наладить отношения с окружающими вас людьми. Например, вам будет проще найти общий язык со своими коллегами по работе.', 'август 2012'),
(96, 12, 'В августе станет более активной сфера личных и эротических отношений: увеличится заинтересованность в любовных связях, не исключено появление новых чувств, симпатий. Вероятны новые знакомства, свидания. В существующих отношениях стоит больше внимания уделять совместному досугу и развлечениям, а также добавлять в отношения больше разнообразия. Этот месяц позволит вам лучше взаимодействовать со своими детьми, отношения с ними станут более гармоничными. В делах стоит избегать чрезмерного риска, это не лучший период для рискованных финансовых операций с чужими деньгами. Вопросы с инвестициями и кредитами старайтесь решать максимально честно и открыто.', 'август 2012'),
(97, 1, 'Расположение планет в сентябре принесет типичным Овнам романтический настрой. Сейчас вы станете более открыты к новым знакомствам и романтическим отношениям. Увеличится стремление к любовным приключениям, притяжение к противоположному полу, возрастет страстность. В существующих отношениях большее значение обретут романтика и физическое притяжение. Первая половина месяца станет благоприятной для работы, особенно если вы заняты в интеллектуальной сфере или занимаетесь посреднической деятельностью. Вторая половина сентября еще больше усилит акцент на сфере личных отношений, позволит находить компромиссы в существующих союзах и с легкостью заводить новые знакомства.', 'сентябрь 2012'),
(98, 2, 'Сентябрь принесет типичным Тельцам возможность обустроить свой дом, сделать его более комфортным, уютным и красивым. Это хорошее время для того, чтобы начать косметический ремонт или сделать перестановку мебели. Отношения с домашними также улучшатся, сейчас вы станете более обаятельными, приветливыми, будете легче идти на компромиссы, что и станет причиной улучшения в отношениях. Также не исключено, что вы станете более напористыми, откровенными. Но возможны и конфликты из-за слишком резкого выражения своих требований или претензий. Будьте открытыми с близким человеком, но не путайте открытость с агрессивностью, не провоцируйте ссоры.', 'сентябрь 2012'),
(99, 3, 'Наибольшая активность типичных представителей вашего зодиакального знака ожидает в сфере профессиональной деятельности. На работе вы станете более энергичными, что позволит успевать намного больше и заметно отразится на производительности вашего труда. Взаимоотношения с коллегами по работе, а также с подчиненными будут более открытыми, но при этом конфликтными. Сейчас вам может потребоваться больше активности для отстаивания собственных интересов. Этот месяц также принесет новые приятные знакомства. Вам будут чаще делать комплименты, появится больше возможностей для флирта, не исключено ваше участие в любовной переписке. Новые знакомства могут происходить на улице, в транспорте, во время поездок, а также в небольших кафе или библиотеках.', 'сентябрь 2012'),
(100, 4, 'Расположение планет в сентябре принесет типичным Ракам удачу в финансовых вопросах. Сейчас вы сможете улучшить свое материальное положение, увеличить доходы и прибыли, не исключено получение подарков. Это время также прекрасно подходит для совершения покупок, особенно если речь идет о приобретении одежды или покупки модных аксессуаров. Высокая активность ожидается и в сфере личной жизни. Новые знакомства в этот период весьма вероятны: вы станете смелее в отношениях с противоположным полом. Это время благоприятно для свиданий. Если же вы уже состоите в паре, старайтесь больше свободного времени проводить вместе. Этот месяц благоприятен для творческого самовыражения, занятий спортом и участия в спортивных состязаниях.', 'сентябрь 2012'),
(101, 5, 'Типичным представителям вашего зодиакального знака в сентябре будет проще проявлять свое личное обаяние. В это время важно лучше выглядеть, так как ваша внешность сможет оказать большое влияние на исход дел. Сентябрь у типичных Львов также будет благоприятным периодом для проведения дома ремонта или выполнения любой работы по дому, требующей высокой активности. Это удачный период для деятельности на приусадебном участке. Обязательно стоит заниматься чем-то активным, если нет работы по дому, уделите внимание спортивным упражнениям. В противном случае неизрасходованная энергия будет уходить на ссоры с членами вашей семьи.', 'сентябрь 2012'),
(102, 6, 'Расположение планет в сентябре указывает на большую прямоту в общении, а также на стремление к спорам и отстаиванию собственного мнения. Сейчас вам будет сложнее промолчать в разговоре. Но старайтесь все же выходить из спора, если чувствуете, что переубедить оппонентов вам все равно не удастся. Также увеличится количество общения, возрастет число коротких поездок или перемещений. В личных отношениях наступает период скрытности. Сейчас не исключено завязывание тайных романов. В течение этого периода могут активизироваться прошлые связи, не исключено возобновление отношений с бывшими пассиями. В существующих союзах старайтесь стремиться к духовному единению с партнером.', 'сентябрь 2012'),
(103, 7, 'В течение сентября вам, вероятно, придется чаще отстаивать собственные принципы. Это хорошее время для того, чтобы защищать собственную территорию, не подпускать людей, которые вам интересны, ближе, чем это требуется. В течение этого месяца вы также сможете больше зарабатывать. Не рекомендуется, правда, активно тратить заработанные деньги, хотя экономить в этом месяце будет довольно сложно. Ваши отношения с друзьями в сентябре станут более гармоничными, вы сможете посвятить им больше времени. В личных отношениях захочется новизны, интересных экспериментов. Одиноким Весам сейчас можно знакомиться в Интернете: именно в Сети вы сможете найти свою любовь.', 'сентябрь 2012'),
(104, 8, 'Сентябрь у типичных Скорпионов окажется весьма активным месяцем. Вы заметите прилив жизненных сил, ваша активность увеличится, повысится интерес к спорту. Занятия спортом сейчас будут давать быстрые результаты: в течение этого периода вы сможете значительно скорректировать свою фигуру. В течение сентября проявляйте больше активности и инициативы, но при этом избегайте чрезмерной агрессивности в своем поведении. В достижении целей, связанных с вашей карьерой, чаще стремитесь проявлять обаяние. Готовность пойти на компромиссы, особенно когда речь идет о каких-то договоренностях с руководством, сейчас будет расценено как ваше положительное качество.', 'сентябрь 2012'),
(105, 9, 'Расположение планет в сентябре принесет типичным Стрельцам удачу в обучении. Это время отлично подходит для того, чтобы записаться на краткосрочные курсы. Причем учиться можно тому, что вам нравится. Сейчас вовсе не обязательно получать профессиональные знания, главное &mdash; удовольствие от процесса обучения. Успешными в сентябре также окажутся поездки, они будут приятными и могут принести новые знакомства романтического характера. Повышается также вероятность любовных отношений с людьми из других стран. Высокой активностью этот месяц отличаться не будет. Возможно, вам будет несколько сложнее проявлять инициативу. Активность и энергичность станут проявляться лишь в моменты одиночества, когда вы сможете полностью погрузиться в занятие собственными делами.', 'сентябрь 2012'),
(106, 10, 'Этот месяц принесет активность и динамику в дружеские отношения. Сейчас вы станете более открытыми в общении со своими друзьями. Не исключено, что круг знакомых расширится, причем за счет представителей мужского пола. Мужчины-Козероги, скорее всего, почувствуют некоторый дух соперничества в дружеских отношениях, женщины же могут заметить романтический интерес к себе кого-то из знакомых. В сентябре типичные Козероги будут удачливы в вопросах, связанных с ведением собственного бизнеса, а также кредитами и инвестициями. В течение этого месяца вы сможете получить кредит на льготных условиях, поэтому не спешите соглашаться с первым же предложением. Не исключено, что появится возможность успешно вложить свободные средства.', 'сентябрь 2012'),
(107, 11, 'Сентябрь типичным Водолеям принесет гармонию в личные отношения. Сейчас вы почувствуете больше тепла со стороны своего партнера, да и сами будете проявлять обаятельность и чувственность. В итоге этот период запомнится как время гармонии, нежности и теплоты. Одинокие Водолеи в сентябре смогут встретить свою любовь и начать серьезные отношения. Если вы не так давно вступили в отношения, то в сентябре они могут перейти в более стабильную фазу. Успех в карьере в этом месяце будет зависеть от вашей энергичности, а порой и напористости. При этом не забывайте демонстрировать свое желание находить компромиссные решения, особенно во время деловых переговоров. Это даст заметный эффект и поможет быстро достигать своих целей.', 'сентябрь 2012'),
(108, 12, 'Расположение планет в сентябре указывает на то, что вы будете активно стремиться к получению новых знаний. Сентябрь станет удачным периодом для обучения, нового профессионального опыта. Полученные знания вы сможете использовать в своей работе. Также можно попытаться найти более интересную должность. Отношения в рабочем коллективе в сентябре также наладятся, станет больше понимания и такта в отношениях с коллегами. Это успешный период для путешествий и активного отдыха. Усилится интерес к другим культурам, что создаст стимул для путешествий за границу. Более активным и динамичным станет взаимодействие с иностранцами.', 'сентябрь 2012'),
(109, 1, 'Типичных Овнов в октябре ожидает удача в профессиональной области. Вы сможете легче устанавливать хорошие взаимоотношения с коллегами, что увеличит производительность труда. В работе будет важен внешний вид, особенно если ваша деятельность связана с общением с людьми. Сейчас коллеги и клиенты будут чаще обращать внимание на то, как вы выглядите. Этот месяц неплохо подходит и для устройства на новую работу. В этом случае вы быстро и безболезненно сможете вписаться в новый коллектив и заслужите симпатии и уважение других сотрудников. Месяц неплохо подходит для активного обучения, приобретения нового опыта, в том числе в профессиональной сфере.', 'октябрь 2012'),
(110, 2, 'Расположение планет в октябре сулит типичным Тельцам много романтики. Сейчас вы будете настроены на развлечения, отдых, новые знакомства и любовные свидания. В существующих отношениях также потребуется больше романтики, поэтому стоит найти время для совместного отдыха вместе с любимым человеком. Больше времени проводите вместе, посещайте развлекательные заведения. Октябрь также принесет раскрытие ваших творческих способностей, вероятен успех в публичных выступлениях, презентациях. Высокая активность в октябре будет также наблюдаться в вопросах, связанных с кредитами. Вы можете либо приложить усилия для того, чтобы досрочно погасить кредит, либо активно искать предложения банков о займах.', 'октябрь 2012'),
(111, 3, 'В октябре типичным Близнецам звезды советуют заняться благоустройством собственного дома или квартиры. Это отличное время для покупки мебели, а также любых других предметов интерьера. Благодаря таким приобретениям вы сможете сделать дом более уютным, создать в нем приятную атмосферу. Поможет также перестановка мебели, внесение различных мелких изменений в доме. Повышенная активность будет наблюдаться в личных отношениях. Вы станете более инициативны, будете более открыто высказывать свою позицию. Это хорошее время для того, чтобы прояснить острые вопросы в вашей паре. В этот период также будет проще сделать первый шаг к новым отношениям, самостоятельно проявить инициативу.', 'октябрь 2012'),
(112, 4, 'Типичных Раков в октябре ждет удача в коротких поездках и небольших путешествиях. Сейчас перемена мест будет доставлять вам удовольствие, во время поездок будут часто встречаться приятные люди, общение с которыми только усилит приятные впечатления от путешествия. Возможны и новые романтические знакомства. Общение в октябре будет складываться довольно легко. Вас будут окружать приятные собеседники, увеличится число комплиментов, появится больше возможностей для флирта. Не стоит сейчас забывать и о работе. Благодаря возросшей энергичности вы сможете справляться со своими обязанности заметно быстрее, что не останется без внимания руководства.', 'октябрь 2012'),
(113, 5, 'Расположение планет в октябре окажется благоприятным для шопинга. Сейчас вы сможете совершить приятные и полезные приобретения, а также неожиданно для себя получить хорошие скидки на товары. Способствовать покупкам будет и улучшающееся материальное положение. Этот месяц сулит увеличение ваших доходов, высока вероятность получения дорогих подарков. Активной будет и романтическая сфера. Сейчас вы будете пользоваться повышенным вниманием со стороны противоположного пола. Если вы еще и сами станете проявлять инициативу, то личная жизнь станет довольно насыщенной. Это отличное время для новых знакомств и начала любовных романов.', 'октябрь 2012'),
(114, 6, 'Типичным Девам пора позаботиться о себе, причем особое внимание стоит уделить своей внешности. Сейчас можно сделать новую прическу, изменить стиль в одежде, полностью обновить гардероб. Это прекрасный месяц для того, чтобы чаще бывать в салонах красоты, а также посещать тренажерные залы или фитнес-центры. В сочетании с правильным питанием это положительно отразится на вашей фигуре и внешнем виде в целом. Заниматься спортом сейчас можно и дома. Возьмите себе за правило делать утреннюю зарядку, и вы заметите, что энергия возрастет, сил будет хватать на большое количество повседневных дел. Работа по дому сейчас будет удаваться вам быстрее и проще, чем обычно, поскольку появится больше энтузиазма для ее выполнения.', 'октябрь 2012'),
(115, 7, 'Весам будет сложно усидеть на одном месте в течение всего месяца. Дела и обстоятельства будут вынуждать вас перемещаться, ездить на личные или деловые встречи. Количество коротких поездок заметно возрастет. При этом важно избегать спешки, особенно если вы находитесь за рулем собственного автомобиля. Постарайтесь не превышать скорость &mdash; ваша жизнь важнее, чем опоздание на совещание или иное срочное мероприятие. В личной жизни это время затишья. Сейчас стоит определиться с тем, что вы ищете в отношениях, а также разобраться в себе. Новые знакомства могут привести к платоническим привязанностям или неразделенным чувствам. В некоторых случаях возможны тайные любовные романы.', 'октябрь 2012'),
(116, 8, 'Высокая активность в октябре будет наблюдаться у Скорпионов в финансовой области. Сейчас вероятно увеличение доходов, что придаст стимул дальнейшей работе. При этом вы будете не только энергично трудиться, но и активно расходовать заработанные деньги. В этот период, скорее всего, появится больше поводов для денежных трат. Но расходы все же лучше контролировать, так вы сможете не растратить созданные ранее сбережения. В течение этого месяца вы можете рассчитывать на поддержку со стороны своих друзей и единомышленников. Отношения с ними сейчас станут более гармоничными, теплыми. Не исключено расширение круга ваших друзей за счет появления в нем представительниц прекрасного пола.', 'октябрь 2012'),
(117, 9, 'Расположение планет указывает на то, что ваша активность и уровень жизненной энергии будут возрастать. Это станет особенно заметно после первой недели октября. Вы будете успевать делать многое за короткие промежутки времени. Правда, и работать станете рывками: последовательная и монотонная деятельность в течение этого периода будет удаваться вам сложнее, чем обычно. Октябрь у типичных Стрельцов станет отличным временем для занятий спортом. Это поможет быстро привести свое тело в норму, сделать фигуру более стройной. Эффект от занятий сейчас будет значительно больше, чем от различных диет. Ведите активный образ жизни, тогда вам точно не придется ограничивать себя в питании.', 'октябрь 2012');
INSERT INTO `forecasts` (`id`, `signId`, `forecast`, `forecastDate`) VALUES
(118, 10, 'Октябрь принесет вам успех в дальних поездках. Лето уже закончилось, а вы еще не были в отпуске? Этот месяц отлично подходит для того, чтобы отдохнуть, причем желательно вдалеке от родины. Сейчас увеличивается потребность в новых ощущениях, поэтому путешествия и связанные с ними впечатления будут весьма актуальны. Отправляться в поездку лучше всего с любимым человеком, тогда путешествие из обычного туристического сразу превратится в романтическое. Одиноким Козерогам расстраиваться не стоит, можно отправляться на отдых и самостоятельно. В этом случае будьте готовы к новым знакомствам и приятным курортным романам.', 'октябрь 2012'),
(119, 11, 'Расположение планет в октябре активизирует интимную сферу. Вы заметите усиление сексуального влечения к противоположному полу. Это прекрасное время для того, чтобы раскрыть свою чувственность, сексуальность, научиться получать больше наслаждения от близости с любимым человеком. Более динамичными станут и ваши взаимоотношения с друзьями. Сейчас близкие люди будут стимулировать вашу активность, периодически вызывая у вас дух соперничества. Важно, чтобы это соперничество не мешало вашей дружбе. Круг вашего общения в этом месяце может расшириться за счет присоединения к нему нескольких представителей сильного пола.', 'октябрь 2012'),
(120, 12, 'Гармонии в личных отношениях в октябре будет достигнуть заметно проще. Поэтому не стоит упускать такой возможности, работайте над тем, чтобы сделать свои отношения теплее, проявите больше внимания, теплоты и заботы к своему любимому человеку. У одиноких Рыб в октябре повышаются шансы завести новые знакомства, которые в скором времени могут дать начало серьезному и длительному любовному роману. Пока не стоит форсировать события, более детальная оценка будущего партнера поможет избежать возможных разочарований. Также это активное время в работе и карьере. Успех сейчас сильно будет зависеть от вашей активности, прямоты и напористости.', 'октябрь 2012'),
(121, 1, 'Первая половина ноября принесет повышенную активность в информационной сфере. Вы будете стремиться к получению новых знаний, поэтому станете более заинтересованными в обучении. Удача будет сопутствовать вам вплоть до середины месяца, поэтому это благоприятное время для записи на какие-либо курсы. Это могут быть занятия по изучению иностранного языка или уроки вокалом &mdash; выбирайте направление на свой вкус. Во второй половине ноября, скорее всего, появятся возможности для применения полученных знаний на практике. Вы сможете использовать их в своей работе, а также как средство достижения других жизненных целей. В течение всего месяца фортуна благоволит личным отношениям. В это время в существующих союзах будет царить гармония, а новые знакомства могут привести к серьезному любовному роману.', 'ноябрь 2012'),
(122, 2, 'Расположение планет в первой половине месяца указывает на возросшее стремление к риску. Сейчас вы будете склонны к смелым действиям более чем когда-либо. Стоит понимать, что последствия ваших поступков в течение этого периода окажутся необратимыми, поэтому старайтесь более тщательно продумывать различные варианты развития событий. Вторая половина месяца позволит вам получить новый жизненный опыт, это время принесет стремление к новым ощущениям. Возможно, напомнят о себе прежние личные отношения: например, объявится бывшая пассия или же вы сделаете шаг к сближению. Это время можно также использовать для возвращения к сотрудничеству с прежними деловыми партнерами. В течение всего ноября удача будет сопутствовать Тельцам в работе. Взаимоотношения с коллегами станут лучше.', 'ноябрь 2012'),
(123, 3, 'Ноябрь типичным Близнецам принесет много романтики. Вы станете пользоваться повышенным успехом у противоположного пола, благодаря чему возрастет число романтических встреч, свиданий. В существующих отношениях больше внимания уделите совместному досугу и отдыху. Творческие люди, рожденные под знаком Близнецы, в ноябре почувствуют ослабление осенней депрессии, а также прилив вдохновения. Это удачный месяц для самовыражения и личного творчества. В первой половине ноября активность будет наблюдаться в сфере личных и деловых отношений. Сейчас успех будет зависеть от вашей смелости и решительности. Уклон в сторону сексуальных отношений увеличится во второй половине месяца. В это время может также возрасти склонность к риску и приключениям.', 'ноябрь 2012'),
(124, 4, 'Типичным Ракам в ноябре звезды рекомендуют больше внимания уделить дому. Благодаря своему природному обаянию вы сможете наладить взаимоотношения с близкими родственниками и членами семьи. Это хорошее время для приема гостей, приятного общения с интересными вам людьми. Сейчас можно и нужно заниматься улучшением интерьера своей квартиры, создавать комфортную и уютную обстановку. Возросшее чувство стиля обязательно вам в этом поможет. В первой половине месяца высокую активность рекомендуется проявить на работе. От вашего трудолюбия сейчас будет зависеть производительность труда и уровень доходов. Во второй половине ноября стоит проявить напористость в личных отношениях. Главное сейчас &mdash; не провоцировать ссоры без серьезных на то причин.', 'ноябрь 2012'),
(125, 5, 'Ноябрь типичным Львам сулит приятные путешествия, однако ретроградный Меркурий в период с 6 по 26 ноября способен несколько омрачить впечатления от них. Для того чтобы этого избежать, на указанный период планируйте только поездки ради отдыха, развлечений и готовьтесь к ним более тщательно. Серьезно стоит отнестись и к выбору попутчиков: желательно, чтобы среди них были только те люди, с которыми вам по-настоящему приятно общаться. В противном случае именно во время поездки могут всплыть нерешенные вопросы из прошлого ваших взаимоотношений. В первой половине месяца вероятны успехи в спорте, творчестве. Вы также станете более активными и решительными при взаимодействии с противоположным полом, что особенно сильно проявится у женщин. Вторая половина месяца благоприятна для занятий спортом. Физические нагрузки сейчас особенно хорошо отразятся на вашем здоровье.', 'ноябрь 2012'),
(126, 6, 'Расположение планет в ноябре указывает на благоприятные возможности для улучшения своего материального положения. Удача будет сопутствовать вам в финансовых вопросах, позволит заключить прибыльные сделки или совершить выгодные покупки. Изменения коснутся ваших внутренних ценностей: например, в ноябре может возрасти стремление к комфорту. Первая половина месяца сделает более динамичными отношения с родственниками и членами вашей семьи. Однако сейчас важно избегать излишних конфликтов и не провоцировать ссоры. Вторая половина месяца усилит романтический настрой. Это время свиданий, новых знакомств и активных развлечений. Не исключены запоминающиеся любовные приключения.', 'ноябрь 2012'),
(127, 7, 'Венера в ноябре будет проходить по вашему зодиакальному знаку, что усилит чувство стиля и красоты, добавит естественного обаяния в повседневном общении. Вы сможете гармонично проявлять основные черты своего характера, это прекрасное время для самовыражения. Месяц благоприятен также для того, чтобы что-то поменять в стиле своего поведения, внешнем виде. Первая половина ноября принесет высокую активность в поездках и больше прямоты в общении. Для того чтобы избежать негативных астрологических влияний, старайтесь более тщательно планировать свои перемещения. В общении опирайтесь на прежний опыт и учитывайте совершенные ранее ошибки, чтобы не повторить их вновь. Во второй половине месяца можно заниматься ремонтом или иной активной работой по дому.', 'ноябрь 2012'),
(128, 8, 'В ноябре вам потребуется больше времени на отдых, который сейчас будет доставлять особенное удовольствие и способствовать повышению активности. В этот период просто необходимы перерывы для восстановления сил. В противном случае вы можете почувствовать слабость или даже довести организм до стрессового состояния. Не исключено появление тайной влюбленности, однако положение планет указывает на вероятность неразделенных чувств. В первой половине месяца вы сможете активно зарабатывать, доходы в это время будут во многом зависеть от вашей активности и решительности. Вторая половина ноября благоприятна для общения, отстаивания собственного мнения. При этом старайтесь избегать ссор и контролировать повышенную склонность к спорам и дискуссиям.', 'ноябрь 2012'),
(129, 9, 'В течение этого месяца улучшатся взаимоотношения с друзьями. Они могут стать более приятными и душевными: близкие люди сейчас будут чаще проявлять личное обаяние и тактичность. В этом месяце возможны знакомства с интересными людьми, которые впоследствии станут вашими хорошими друзьями. В первой половине ноября вы, скорее всего, заметите усиление активности, станете более энергичными в своем поведении, будете открыто проявлять свой характер. Усилится решительность и напористость. Этот период можно использовать для занятий спортом, особенно если вы хотите добиться идеальной физической формы, сбросить лишние килограммы и подтянуть мышцы. Во второй половине месяца акцент перейдет на финансовую сферу. Доходы могут возрасти, но при этом стоит более внимательно контролировать свои траты.', 'ноябрь 2012'),
(130, 10, 'У Козерогов удача в вопросах карьеры в течение ноября возрастет. Успех будет нередко зависеть от вашего обаяния и внешнего вида. На эти моменты стоит обратить особое внимание, если вы собираетесь на встречу с руководством или на важное деловое совещание. Умение идти на компромиссы сейчас также может стать важным качеством для достижения желаемого. В первой половине месяца жизненная энергия будет не на самом высоком уровне, поэтому любую активность желательно чередовать с отдыхом. Это удачное время для того, чтобы чуть больше времени проводить в одиночестве. Во второй половине ноября вы почувствуете прилив сил, благодаря чему сможете справляться быстрее с любыми делами.', 'ноябрь 2012'),
(131, 11, 'Расположение планет в ноябре сулит типичным Водолеям удачу в учебе. Взаимоотношения с сокурсниками и преподавателями у студентов заметно улучшатся. Не исключены ошеломительные успехи в обучении или просто везение на экзаменах. Активизируются также отношения с иностранцами: в этот период возможны новые знакомства с людьми из других стран. Активное расширение круга общения наиболее вероятно в первой половине месяца. Во многом этому будет способствовать ваша активная жизненная позиция. Первая половина ноября также принесет усиленное желание реализовать свои планы и идеи. После 15 числа больше времени стоит уделять отдыху, в том числе активному.', 'ноябрь 2012'),
(132, 12, 'В течение этого месяца активизируется интимная сторона вашей жизни, увеличится гармония в личных отношениях. Это время благоприятно для улучшения взаимопонимания в паре, проявления большей мягкости и заботы друг о друге. В первой половине ноября вы сможете более активно добиваться своих целей. Результаты будут зависеть от вашей напористости, решительности и энергичности. Сейчас рекомендуется открыто говорить о своих планах, именно так вы сможете расположить к себе людей. Вторая половина месяца сделает ваши отношения с друзьями более динамичными. Возможно, появится чувство соперничества, благодаря которому вы сможете более активно реализовывать собственные идеи.', 'ноябрь 2012'),
(133, 1, 'Высокая активность в карьере ожидает типичных Овнов в декабре. Сейчас успех будет зависеть от того, насколько активно и решительно вы будете добиваться своих целей и отстаивать собственные интересы. Это не означает, что нужно стать более агрессивным человеком, но проявить больше смелости определенно стоит. В первой половине месяца вы также сможете успешно решать вопросы, связанные с ведением собственного бизнеса, а также дела, имеющие отношение к долгам, кредитам, управлению чужими деньгами. Вторая половина декабря подходит для путешествий, общения с иностранцами, развлекательных поездок. Удача будет сопутствовать вам в обучении и получении высшего образования.', 'декабрь 2012'),
(134, 2, 'Положение планет в декабре указывает на увеличивающуюся тягу к новым знаниям, впечатлениям и приключениям. Это хороший месяц для обучения, особенно самостоятельного, проведения опытов, экспериментов. Также декабрь удачен для активного отдыха, путешествий. Первая половина месяца принесет гармонию в личную жизнь. Сейчас стоит налаживать отношения с партнером по браку, углублять романтические отношения. Новые знакомства возможны, но важно следить за тем, чтобы в них были настоящие чувства, а не только страсть и физическое влечение. Вторая половина месяца неплохо подходит для решения вопросов, связанных с налогами и инвестициями.', 'декабрь 2012'),
(135, 3, 'В декабре у типичных представителей вашего зодиакального знака заметно возрастет склонность к риску и приключениям. Вы станете смелее, но в вашем характере появится и больше авантюризма, чрезмерной склонности идти на риск. Сейчас можно и нужно принимать смелые решения, но делать это следует максимально ответственно, просчитывая возможные последствия, как положительные, так и негативные. Декабрь неплохо подходит для последовательных перемен в работе. В этот период можно вносить корректировки в распорядок своего дня, менять служебные обязанности, а при необходимости и место работы. Сейчас вам также будет проще справляться со сложными задачами в своей деятельности, поэтому не откладывайте их в долгий ящик.', 'декабрь 2012'),
(136, 4, 'Последний месяц года принесет типичным Ракам много романтики. Сейчас вы хорошо будете понимать, что хотите получить от романтических отношений и какой партнер вам нужен. Это позволит вам завести удачные знакомства и последовательно развить новый любовный роман, который может перерасти в длительный и крепкий союз. Не стоит бояться проявлять чуть больше инициативы, от этого ваша личная жизнь станет лишь динамичнее. В существующих отношениях увеличится стремление к укреплению связи, не исключено возникновение желания узаконить ее. Вы можете сами проявить подобную инициативу или получить такое предложение от партнера.', 'декабрь 2012'),
(137, 5, 'Расположение планет в декабре указывает на то, что вы будете тратить больше времени на домашние дела и урегулирование внутрисемейных вопросов. При этом вы с охотой станете браться за выполнение подобных обязанностей. Это отличное время для того, чтобы привести в порядок свой дом перед встречей Нового года: провести генеральную уборку, сделать небольшой ремонт или заняться перестановкой мебели. Все это будет способствовать ощущению большего комфорта в вашем жилище. Вторая половина декабря не менее благоприятна для развлечений, отдыха, флирта, посещения вечеринок и иных увеселительных мероприятий. Это время также удачно для романтических свиданий, личного творчества и общения с детьми.', 'декабрь 2012'),
(138, 6, 'Декабрь принесет много общения, которое будет более приятным и отчасти фривольным в первой половине месяца и более деловым &mdash; во второй. В течение всего декабря вы сможете завести много новых знакомств, пообщаться с большим количеством интересных людей. В первой половине месяца вероятны романтические встречи, вы чаще будете получать комплименты, возрастет ваш успех у противоположного пола. Принимайте приглашения на свидания, если вы свободны и хотите начать серьезный любовный роман. Каждая из встреч в это время может привести к началу отношений. На вторую половину месяца можно запланировать деловое общение, работу с бумагами и командировки.', 'декабрь 2012'),
(139, 7, 'Расположение планет в декабре указывает на стремление к упрочнению своего финансового положения. Сейчас для вас будет важным не столько размер дохода, сколько его стабильность. Многие поступки будут вами предприняты именно для достижения этой цели. Вам захочется быть уверенными в завтрашнем дне, поэтому это неплохое время для того, чтобы начать копить деньги. В течение этого месяца вы также можете успешно совершить покупки для дома, причем любого масштаба. Любые приобретения помогут вам сделать дом более уютным и комфортным для жизни. Вторая половина декабря принесет удачу в коротких поездках. Путешествия сейчас могут стать для вас источником новых знакомств.', 'декабрь 2012'),
(140, 8, 'Последний месяц 2012 года принесет типичным Скорпионам оживленное общение. В разговорах вы сейчас будете прямо и открыто выражать свое мнение, что может увеличить количество споров. Старайтесь не переусердствовать в защите своей правоты, отстаивайте свое мнение более спокойно. В этом случае дискуссии будут продуктивными. Первая половина декабря подходит для того, чтобы проявлять личное обаяние, что-то менять в своей внешности, стиле одежды. Вторая половина месяца окажется благоприятным периодом для совершения различных приобретений. Если вы забудете выбрать для кого-нибудь подарок к Новому году заранее, у вас будет шанс исправить эту оплошность.', 'декабрь 2012'),
(141, 9, 'В декабре повышенной активности потребует финансовая сфера. Сейчас вы сможете активно зарабатывать, если будете использовать свою напористость и энергичность. Не менее активными могут оказаться и расходы, поэтому старайтесь более внимательно контролировать свой личный бюджет. При этом первая половина декабря принесет вам стремление к отдыху. В это время стоит больше времени уделять приятным для вас делам, это поможет быстро восстановить силы и избежать плохого настроения. Вторая половина месяца усилит желание внести изменения в свой внешний вид. В это время можно сделать новую прическу, немного поменять стиль одежды, приобрести модные вещи и аксессуары.', 'декабрь 2012'),
(142, 10, 'Ваша активность в декабре будет довольно высокой. Вы почувствуете прилив сил и жизненной энергии, поэтому вам сложнее будет усидеть на одном месте. Этот месяц отлично подходит для выполнения дел, которые требуют энергичности, умения быстро принимать решения. Это хороший период для занятий спортом. Если вы на регулярной основе посещаете фитнес-клуб, то ваш прогресс сейчас станет более заметным. Первая половина декабря благоприятна для общения с друзьями. Также в течение этого периода вам будет сопутствовать удача в реализации собственных планов и проектов. Во второй половине месяца больше внимания стоит уделить отдыху. Занимаясь любимым делом в спокойной обстановке, вы будете ощущать гармонию и душевный комфорт.', 'декабрь 2012'),
(143, 11, 'Активный отдых и общение с природой будет отличным способом провести время в декабре. Это позволит вам избежать стрессов и перенапряжения, своевременно восстановить резервы своего организма. В первой половине декабря используйте свое обаяние для того, чтобы достичь успеха в карьере. В этой области вам сейчас будет сопутствовать удача. Вторая половина декабря принесет гармонию в дружеские взаимоотношения, позволит заручиться поддержкой близких. Это время замечательно подходит для общения и развлечений вместе с друзьями. Коллективный отдых даст вам не меньше положительных эмоций, чем пребывание на природе.', 'декабрь 2012'),
(144, 12, 'Этот месяц принесет типичным Рыбам много новых идей, заметно усилит активность в их осуществлении. Быть может, не все планы окажутся перспективными, но за счет своей деловой хватки вы успеете попробовать многие из них. Что-то обязательно получится и приведет к хорошим результатам. Именно благодаря вашей активности этот период можно считать удачным. Первая половина декабря подходит для путешествий, общения с иностранцами. Удача ждет вас также в обучении. Вторая половина месяца позволит проще достигать своих целей, особенно в карьерных вопросах. В это время не исключены интересные встречи с влиятельными или известными людьми.', 'декабрь 2012');
